import React, { PureComponent } from "react";
import {
  BarChart,
  Bar,
  Brush,
  ReferenceLine,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
} from "recharts";
import Data from "../Data/tableData";
import "../Page/Work.css";

const data = Data;

export default class Example extends PureComponent {
  static jsfiddleUrl = "https://jsfiddle.net/alidingling/mc8r7e6p/";

  render() {
    return (
      <BarChart
        layout="vertical"
        width={800}
        height={800}
        data={data}
        margin={{
          top: 20,
          right: 20,
          bottom: 20,
          left: 20,
        }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis type="number" domain={["dataMin", "dataMax"]} />
        <YAxis
          dataKey="name"
          width={220}
          font-family="Prompt"
          type="category"
        />
        <Tooltip />
        <Legend
          payload={[
            {
              id: "มิติกิจกรรมการทำงาน",
              value: "มิติกิจกรรมการทำงาน",
              type: "square",
              color: "#536dfe",
            },
            {
              id: "มิติบริบทการทำงาน",
              value: "มิติบริบทการทำงาน",
              type: "square",
              color: "#ff5252",
            },
            {
              id: "ค่าเฉลี่ย",
              value: "ค่าเฉลี่ย",
              type: "square",
              color: "#cfd8dc",
            },
          ]}
        />
        <ReferenceLine y={0} stroke="#000" />
        <Brush dataKey="name" height={30} stroke="#536dfe" />
        <Bar dataKey="activity" fill="#536dfe" />
        <Bar dataKey="context" fill="#ff5252" />
        <Bar dataKey="mean" fill="#cfd8dc" />
      </BarChart>
    );
  }
}
